script: |
  super -f text -I q1734.spq | sort > q1734.out

inputs:
  - name: q1734.spq
    data: |
      SELECT col1 AS col2 FROM tab1 (FORMAT parquet) WHERE col1 + col2 * + col1 NOT BETWEEN 41 + - 45 AND 13 * - col2;
  - name: tab1

outputs:
  - name: q1734.out
    data: |
      14
      47
      5
